import React, {useState} from "react";
import logo from '../images/logo.png';
import {link} from 'react-scroll';
function Navbar(){
    return (
        <nav className={nav ? "nav active" : "nav"}>
            <link to='#' className="logo">
                <img src={logo} alt="" />
            </link>

        </nav>
    )
}

export default Navbar;
